Right, The problem was that the items were in the ItemsSource before it was set on the TabControl, fix by adding this method:

protected override void OnItemsSourceChanged(System.Collections.IEnumerable oldValue, System.Collections.IEnumerable newValue)
{
    base.OnItemsSourceChanged(oldValue, newValue);
    UpdateSelectedItem();
}

Thank you so much! I'm fussy about my work so the performance hit when changing tabs was driving me crazy!

I still got the same delay when dragging/dropping tabs but solved it by modifying the OnItemsChanged event to run the Remove operation at a lower dispatcher priority then the Add one so it gave the Add operation a chance to cancel the Remove one and reuse the ContentPresenter. 

Here's the code if anyone else wants:

case NotifyCollectionChangedAction.Add:
case NotifyCollectionChangedAction.Remove:

// Search for recently deleted items caused by a Drag/Drop operation
if (e.NewItems != null &amp;&amp; _deletedObject != null)
{
    foreach (var item in e.NewItems)
    {
        if (_deletedObject == item)
        {
            // If the new item is the same as the recently deleted one (i.e. a drag/drop event)
            // then cancel the deletion and reuse the ContentPresenter so it doesn't have to be 
            // redrawn. We do need to link the presenter to the new item though (using the Tag)
            ContentPresenter cp = FindChildContentPresenter(_deletedObject);
            if (cp != null)
            {
                int index = _itemsHolder.Children.IndexOf(cp);

                (_itemsHolder.Children[index] as ContentPresenter).Tag =
                    (item is TabItem) ? item : (this.ItemContainerGenerator.ContainerFromItem(item));
            }
            _deletedObject = null;
        }
    }
}

if (e.OldItems != null)
{
    foreach (var item in e.OldItems)
    {

        _deletedObject = item;

        // We want to run this at a slightly later priority in case this
        // is a drag/drop operation so that we can reuse the template
        this.Dispatcher.BeginInvoke(DispatcherPriority.Render,
            new Action(delegate()
        {
            if (_deletedObject != null)
            {
                ContentPresenter cp = FindChildContentPresenter(_deletedObject);
                if (cp != null)
                {
                    this._itemsHolder.Children.Remove(cp);
                }
            }
        }
        ));

        //_itemsHolder.Children.Remove(cp);
    }
}

_deletedItem was just a private object declared at the top of the page
private object _deletedObject = null;
